import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import hmnlogo from '../logoGroup.png';

function NavBar() {
  return (
<>
    <Navbar bg="white" variant="light" height="60" display="flex">
        <Container>
          <Navbar.Brand href="#">
            <img
              alt=""
              src={hmnlogo}
              className="d-inline-block align-top"
              style={{ height:"28px", margin:"30px"}}     
            />{' '}
          </Navbar.Brand>
          <Button style={{color:"darkblue", margin:"10px"}}>BETA</Button>
          <Navbar.Text margin-bottom="20px">
          <a href="#contact">Contact Us</a>
          <a href="#login">Member Login</a>
        </Navbar.Text>

        </Container>
      </Navbar>
      </>   

  );
}

export default NavBar;
